Este poema es un conocido soneto humorístico de Manuel del Palacio (1831-1906), poeta español del Realismo que destacó por sus composiciones satíricas y humorísticas. El contraste entre el tono elevado y romántico de los tres primeros cuartetos y el desenlace prosaico del último verso es característico de su estilo.
